                translates: {x:0, y:0},
                scale: 1
            };

            if(lastTransFormObj_d3style !== null){
                transformObj.translates.x = lastTransFormObj_d3style.x;
                transformObj.translates.y = lastTransFormObj_d3style.y;
                transformObj.scale = lastTransFormObj_d3style.k;
            }

            //右クリック位置の保存
            lastCoordinate.rightClick.x = ((x - (boundingClientRect.left + window.pageXOffset)) - transformObj.translates.x) / transformObj.scale;
            lastCoordinate.rightClick.y = ((y - (boundingClientRect.top + window.pageYOffset)) - transformObj.translates.y) / transformObj.scale;

            var $win = $(window);

            //<Same as jquery.contextMenu-2.7.1.js>-----------------

            var offset;
            // determine contextMenu position
            if (!x && !y) {
                opt.determinePosition.call(this, opt.$menu);
                return;
            } else if (x === 'maintain' && y === 'maintain') {
                // x and y must not be changed (after re-show on command click)
                offset = opt.$menu.position();
            } else {
                // x and y are given (by mouse event)
                var offsetParentOffset = opt.$menu.offsetParent().offset();
                offset = {top: y - offsetParentOffset.top, left: x -offsetParentOffset.left};
            }

            // correct offset if viewport demands it
            var bottom = $win.scrollTop() + $win.height(),
                right = $win.scrollLeft() + $win.width(),
                height = opt.$menu.outerHeight(),
                width = opt.$menu.outerWidth();

            if (offset.top + height > bottom) {
                offset.top -= height;
            }

            if (offset.top < 0) {
                offset.top = 0;
            }

            if (offset.left + width > right) {
                offset.left -= width;
            }

            if (offset.left < 0) {
                offset.left = 0;
            }

            opt.$menu.css(offset);

            //----------------</Same as jquery.contextMenu-2.7.1.js>
        },
